sys_variable_value.value:
(function execute(inputs, outputs) {

  new AzureComputeUtils().checkIfEmpty(inputs);
  var resourcePath = ['subscriptions/',inputs.subscriptionId,'/providers/Microsoft.Compute/locations/',inputs.location,'/publishers/',inputs.publisherName,'/artifacttypes/vmimage/offers/',inputs.offer,'/skus/',inputs.skus,'/versions/',inputs.version].join('');


  outputs.resourcepath = resourcePath;


})(inputs, outputs);

